DROP DATABASE IF EXISTS BTP2;
CREATE DATABASE BTP2;
USE BTP2;
CREATE TABLE WIFI_MGT(id integer,tracetype VARCHAR(100),link_layer_header_type VARCHAR(100),link_layer_destination VARCHAR(100),node_number VARCHAR(100),link_layer_source VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE WIFI_CTL_ACK(id integer,tracetype VARCHAR(100),link_layer_header VARCHAR(100),node_number VARCHAR(100),link_layer_header_type VARCHAR(100),time VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE WIFI_DATA_ArpHeader (id integer,network_layer_destination VARCHAR(100),tracetype VARCHAR(100),link_layer_header_type VARCHAR(100),link_layer_destination VARCHAR(100),arp_header_type VARCHAR(100),node_number VARCHAR(100),network_layer_source VARCHAR(100),link_layer_source VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),network_layer_header VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE WIFI_DATA_Ipv4Header (id integer,network_layer_destination VARCHAR(100),tracetype VARCHAR(100),link_layer_header_type VARCHAR(100),link_layer_destination VARCHAR(100),ipv4_length VARCHAR(100),data_payload VARCHAR(100),node_number VARCHAR(100),transport_layer_header VARCHAR(100),network_layer_source VARCHAR(100),source_port VARCHAR(100),link_layer_source VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),network_layer_header VARCHAR(100),destination_port VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE CSMA_DATA_ArpHeader (id integer,network_layer_destination VARCHAR(100),tracetype VARCHAR(100),link_layer_destination VARCHAR(100),arp_header_type VARCHAR(100),node_number VARCHAR(100),network_layer_source VARCHAR(100),link_layer_source VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),network_layer_header VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE CSMA_DATA_Ipv4Header (id integer,network_layer_destination VARCHAR(100),tracetype VARCHAR(100),data_payload VARCHAR(100),link_layer_destination VARCHAR(100),ipv4_length VARCHAR(100),node_number VARCHAR(100),transport_layer_header VARCHAR(100),network_layer_source VARCHAR(100),source_port VARCHAR(100),link_layer_source VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),network_layer_header VARCHAR(100),destination_port VARCHAR(100),PRIMARY KEY(id) );
CREATE TABLE P2P_DATA_Ipv4Header (id integer,network_layer_destination VARCHAR(100),tracetype VARCHAR(100),data_payload VARCHAR(100),node_number VARCHAR(100),transport_layer_header VARCHAR(100),network_layer_source VARCHAR(100),source_port VARCHAR(100),ipv4_length VARCHAR(100),time VARCHAR(100),link_layer_header VARCHAR(100),network_layer_header VARCHAR(100),destination_port VARCHAR(100),PRIMARY KEY(id) );
